import React from 'react'
import CatalogItem from ''

export default function Catalog() {
  const catalog = require('./data/catalog.json')

  return (
    <div>
      <table>
        <tr><th>Item Type</th><th>Color</th></tr>
        {catalog.map(item => {
          if(catalog[item.id] === undefined) return
          else
            <tr><td>{item.itemType}</td><td>{item.color}</td></tr>
        })}
      </table>
    </div>
  )
}
